import React from "react";
import { Image } from 'semantic-ui-react';

function SegaJamesLogo() {
    return(
        <Image src={require("../../../images/segaJamesLogo.png")} alt="nerdstillery" className="segaLogo" size="massive" />
    )
}

export default SegaJamesLogo;
